import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Navbar from "./components/Navbar";
import Header from "./components/Header";
import Aboutme from "./components/Aboutme";
import Projects from "./components/Aboutme";


function App() {
  return (
    <>
   <Navbar/>
   <Header/>
   <Aboutme/>
   <Projects/>
   </>
  );
}

export default App;
